import React, { FC } from 'react';

interface Props {
    handleClick?: any;
}

const index: FC<Props> = ({ handleClick }) => {
    React.useEffect(() => {
        console.log(handleClick);
    });
    return (
        <div>
            <div className="h-screen -w-72 bg-white z-50 absolute"></div>
        </div>
    );
};

export default index;
